import React, { useEffect, useState, useCallback } from 'react';

export default function List({ getItems }){
    const [items, setItems] = useState([])

    useCallback(() => {
        setItems(getItems())
        console.log('Updating items')
    }, [getItems])

    return items.map(item => <div key={item}>{item}</div>)
}
